import React from "react";

function Navbar() {
  return (
    <div>
      <div className="flex justify-center ">
        <img
          className="mt-20 border-4 border-green-400 rounded-full h-32 w-32 object-cover"
          src="images/ronaldinho.jpg"
          alt=""
        />
      </div>
      <div>
        <p className="text-gray-200 mt-5 font-bold text-2xl text-center">
          Ronaldinho
        </p>
      </div>
      <div className="mt-3 text-xl text-gray-200 text-center">
        <p>@Ronaldikin</p>
      </div>
    </div>
  );
}

export default Navbar;
